import React from "react";

export default function Banner({ children, title, subtitle }) {
  return (
    <div className="col-md-12 flex-box">
      <div className="flex-box-child">
        <h1 className="col-md-12 text-center">{title}</h1>
        <p className="col-md-12 text-center">{subtitle}</p>
      </div>

      {children}
    </div>
  );
}
